static std::vector<unsigned char> DecryptBytes(std::vector<unsigned char> section, byte key_byte, int section_number, int size_section, int size_key)
{
	//generic wait function
	if (section_number % 2 == 0)
	{
		Sleep(1000);
	}

	//NEED TO PLACE KEY TOTAL HERE
    unsigned char decrypted_code[5180];

    //decryption loop	
    for (int i = 0; i < size_section; i++) 
    {
        int integer = int(section.data()[i]) - int(key_byte);
        if (integer < 0)
        {
            integer = 256 + integer;
        }
        decrypted_code[i] = byte(integer);
    }
	
	std::vector<unsigned char> decrypted(decrypted_code, decrypted_code + size_section);
	return decrypted;
}

